import React from 'react';
import PropTypes from 'prop-types';

const LabelInputs = props => {
    const { placeholder, value, visible } = props;
    return (
        <div id="float-label">
        <input type="email" />

        <label htmlFor="email">
          E-mail
        </label>
      </div>
    );
};

export default LabelInputs;
